import React, { Component } from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { logoutUser } from "../../store/actions/authActions";

class Dashboard extends Component {
  onLogoutClick = e => {
    e.preventDefault();
    this.props.logoutUser();
  };

  render() {
    const { user } = this.props.auth;
    return (
      <div style={{ height: "75vh" }} className="container valign-wrapper">
        <div className="row">
          <div className="col s12 center-align">
            <button className="btn pull-left">  Profile </button>
            <button onClick={this.onLogoutClick} className="btn pull-right">  Logout </button>
          </div>
        </div>
        <div className="container bk-dark-purple">
          <div className="row pad-dashboard">
            <div className="col-md-8 dash-board-image">
              <ul className="ul-dash-board-image">
                <li><img src="./images/testimonial-1.jpg" /></li>
                <li className="profile-details">
                  Hello sapn
                </li>
              </ul>
            </div>
            <div className="col-md-4 dash-board-image">
              <ul className="ul-profile-list">
                <li>Phone: 0706-857-6214</li>
                <li>Email: emmanueliyanu2012@gmail.com</li>
                <li>Location: Lagos Nigeria</li>
              </ul>
            </div>
          </div>
        </div>
      </div>

    );
  }
}

Dashboard.propTypes = {
  logoutUser: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired
};
const mapStateToProps = state => ({
  auth: state.auth
});
export default connect(
  mapStateToProps,
  { logoutUser }
)(Dashboard);
